import { Col, Container, Row } from "react-bootstrap";
import "../styles/navbar.css"
const Navbar = () => {
    return (
            <nav className = "navbar">
                <Row>
                    <Col xs={6} md={9} ><h1>Analyse Coderhub</h1></Col>
                    <Col xs={6} md={3} >
                        {/* hide on small screen */}
                        <div className="mt-3 links d-none d-md-block">
                            <a href="/">Home</a>
                            <a href="/Profile">About</a>
                            <a href="/Profile">Downlaods</a>
                        </div>

                        {/*hide on medium and larger screens*/}
                        <div className="mr-auto d-block d-md-none d-flex justify-content-end">
                            <i className="bi bi-list"></i>
                        </div>
                    </Col>
                </Row>
            </nav>
    );
}

export default Navbar;
